webpackJsonp([0x96a094fd39d4],{4319:function(t,a){t.exports={data:{markdownRemark:{html:"<p>1981年10月12日生まれの二十歳です(16進数的な意味で)。近所のガキに“おじさん”呼ばわりされたのがもう10年前です。 体力とか考えると色々ともう年だなぁ、とは思いますが、行動力と幻創力だけはあと10年くらいは10代後半並みでありたい。  因みに天秤座の人間は、車を運転中人を跳ね飛ばしやすいそうな……あぁこわ。交通事故歴は2回あるが、今のところいずれも被害者。しかも11年に一度、救急車で運ばれる法則が成り立ってしまってるｗ……となると、次は三十路半ば……こわ！ などと言っていたら2010.12に急病で倒れて救急車に運ばれた。しかしこれは事故じゃないのでノーカウント(?)</p>",frontmatter:{cover:null,date:"2012-11-27T22:30:28+09:00",strDate:"2012/11/27",title:"代表の年齢"}}},pathContext:{path:"/ja/blog/2012/11/27-代表の年齢/",langKey:"ja"}}}});
